import { Route, Switch } from 'react-router';
import '../App.css';
import Header from './Header';
import Start from './Start';
import Step1 from './Step1';
import Popup from './Popup';

function App() {
  return (
    <div className="App">
      <Header />
      <Switch>
        <Route exact path='/'>
          <Start />
        </Route>
        <Route path='/step1'>
          <Popup />
          <Step1 />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
